import React from 'react';
import { Link } from 'react-router-dom';

const PlantItem = ({ plant }) => {

  return (
    <div>
      {filteredPlants.map((plant) => (
    <tr key={plant.id}>
      <td>
        <Link to={`/plant/${plant.id}`}>{plant.latinName}</Link>
      </td>
      <td>{plant.family}</td>
      <td>{plant.category}</td>
      <td>{plant.style}</td>
      <td>{plant.growth}</td>
    </tr>
  ))}
    </div>
  );
};

export default PlantItem;
